import "./WelcomePirate.css";

const WelcomePirate = () => {
  return (
    <div id="welcomeDiv">
      <h1>Welcome Pirate!!</h1>;
      <div id="innerDiv">
        <span>
          <img src="/public/images/pic2.webp" />
        </span>
        <p>Meet Jack. Jack is a Gentleman Pirate.</p>
        <p> He will guide you through your journey</p>
      </div>
    </div>
  );
};

export default WelcomePirate;
